from collections import Counter
class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        return next(iter(Counter(t) - Counter(s)))

class Solution2:
    def findTheDifference(self, s: str, t: str) -> str:
        return (Counter(t) - Counter(s)).most_common(1)[0][0]

